To decide membership, we apply the CYK algorithm.  Label each position i with the set of NTs that produce the terminal there, then fill in length–2 spans by checking all binary rules X→Y Z to see if Y is in the left cell and Z in the right.  We find:

Position 1 “t91”: {NT53, NT7}  
Position 2 “t45”: {NT56, NT4}  
Position 3 “t29”: {NT25}  
Position 4 “t89”: {NT1}  
Position 5 “t28”: {NT56, NT11, NT59}  
